Write a JavaScript program to remove all duplicated elements from an array. [1, 2, 3, 2, 4, 3] -> [1, 2, 3, 4]

## Step 1: Understand the problem
The problem asks to remove all duplicated elements from an array, meaning we need to create a new array that contains each element only once.

## Step 2: Choose a method to solve the problem
One way to solve this problem is to use the Set data structure in JavaScript. The Set data structure automatically removes any duplicate values.

## Step 3: Write the JavaScript code
Here is the JavaScript code to solve the problem:
```javascript
function removeDuplicates(arr) {
  return [...new Set(arr)];
}

